import React from "react";
import "../stylesheets/ClubList.scss";
import Club from "./Club";

const ClubList = (props) => {
  return (
    <ul className="list">
      {props.clubsData.map((eachClub) => {
        return <Club eachClub={eachClub} />;
      })}
    </ul>
  );
};

export default ClubList;
